DROP TABLE IF EXISTS `planned_proj`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `planned_proj` (
  `id` int NOT NULL AUTO_INCREMENT,
  `region` varchar(120) DEFAULT NULL,
  `project` varchar(250) DEFAULT NULL,
  `length` varchar(50) DEFAULT NULL,
  `contractor` varchar(120) DEFAULT NULL,
  `category` varchar(120) DEFAULT NULL,
  `date_commenced` date DEFAULT NULL,
  `date_completed` date DEFAULT NULL,
  `revised_date` date DEFAULT NULL,
  `contract_sum` varchar(50) DEFAULT NULL,
  `revised_sum` varchar(50) DEFAULT NULL,
  `amt_to_date` varchar(50) DEFAULT NULL,
  `video_title` varchar(300) DEFAULT NULL,
  `video_link` varchar(250) DEFAULT NULL,
  `video_description` text,
  `video_thumb` varchar(50) DEFAULT NULL,
  `uploaded_time` datetime DEFAULT NULL,
  `user_id` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `planned_proj_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=168 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;
