INSERT INTO `post` VALUES (1,'Aburi – Ayi Mensah road temporarily opened – Ghana Highway Authority','aburi-ayi-mensah-road-temporarily-opened-ghana-highway-authority','The Ghana Highway Authority (GHA) says it has temporarily opened the south-bound lane on the Aburi – Accra road from the Peduase Lodge to Ayi  Mensah to vehicular movement.  \r\n\r\nThe decision which it says was influenced in part by the festive season takes effect from December 28.  \r\n\r\n\r\n \r\n“The Ghana Highway Authority wishes to inform the general public, especially motorist using the Aburi Road that, the South-bound lane; Peduase to Ayi Mensah section which was closed to the public due to slopes failure is OPENED for use during this festive season from Saturday 28th December 2019 to 30th January 2020,” the statement said. \r\n\r\nPolice announced the closure of the road in October 2019 following a landslide. \r\n\r\nThis was after Motorists got stranded after a heavy downpour. \r\n\r\nVideos circulated on social media show motorists struggling to navigate the road that connects the Eastern Region to Accra.\r\n\r\nIn a post on its official Facebook page, the Ghana Police Service explained that the closure of the road was to prevent casualties.\r\n\r\n\r\n \r\n“Police Highway and NADMO [National Disaster Management Organisation] are at the scene,” the post added.',0,20,'0592addf15d6a76f.jpg',1,'2021-04-06 09:58:26'),(2,'Windows Password Recovery Tool 6.4.4.0 Pro Crack + Keygen 2019','windows-password-recovery-tool-6440-pro-crack-keygen-2019','kfghadskfjhwd',0,1,'6da7321f72c0bdaf.png',1,'2021-05-24 12:04:09'),(3,'Windows Password Recovery Tool 6.4.4.0 Pro Crack + Keygen 2019','windows-password-recovery-tool-6440-pro-crack-keygen-2019','Hello Ghana',0,2,'f7e3703bdb48d851.jpg',1,'2021-09-05 12:50:04');
